import React from 'react';

class Search extends React.Component {

  constructor() {
    super(props);
  }

  _onKeyDown = (e) => {
    if (e.key === 'Enter') {
      this.search(e.target.value);
    }
  }

  search(value) {
    console.log('search for band with name: ' + value);
  }

  render() {
    return (
      <div className="ui center aligned grid" style={{ margin: '50px' }}>
        <div className="ui fluid category search">
          <div className="ui icon input">
            <input onKeyDown={this._onKeyDown} className="prompt" type="text" placeholder="Search bands..." />
          </div>
          <button onClick={this.search} className="ui primary button" style={{ margin: '20px'}}>Go</button>
          <div className="results"></div>
        </div>
      </div>
    );
  }

}

export default Search;
